script: |
  super -f text -I q8954.spq | sort > q8954.out

inputs:
  - name: q8954.spq
    data: |
      SELECT 96 - - col1 / - 91 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 IN ( + + col0 * + col1 + col2 - col1 * - col0 );
  - name: tab1

outputs:
  - name: q8954.out
    data: |
      96
      96
      96
